import { Helmet } from "react-helmet";
const Blogs = () => {
    return (
        <>
            <Helmet>
                <meta charSet="utf-8" />
                <title>Blog Articles</title>
                <link rel="canonical" href="http://mysite.com/example" />
            </Helmet>
            <h1>Blog Articles</h1>
        </>

    )
};
export default Blogs;
